  03> KEMP, Garry Athol m on 24.05.1975 to MITCHELL, Delwyn Jan
  b 04.06.1953
  b 18.01.1957
  Garry b. at Warkworth and m. at Whangarei. Delwyn, d/o Claude Mervyn Mitchell and Beverley Marianne
  Horne, b. at Whangarei. Address: 3 Julia Drive, Bunbury 6230, Western Australia.
  Garry is supervising a team of sheetmetal workers at the new Collie Power Station in Western
  Australia.
  Delwyn worked in McKenzies for two years then for five years as a pharmacy assistant and is now
  working with disabled children, helping with schooling and transportation.
  Garry enjoys fishing, boating, diving and football whilst Delwyn's interests are gardening and
  walking.
  b1> KEMP, Harley James
  b 29.04.1979
