  Jack Bartlett and Frances Stella Nora Denton. Michael has sons Christopher, Gary and Martyn from a
  previous marriage. Address: 5 Clark Street, Hikurangi.
  Gail has worked as a waitress, clerical worker and head lady in the Bake House at Coles New World.
